        "Giống chó Rhodesian Ridgeback là một dòng chó to, thân hình cơ bắp, chắc nịch rất mạnh mẽ và khỏe khoắn, các cặp chân to cao rắn chắc, chiếc cổ dài và ngực rất rộng, bụng thóp. Chúng có kích thước chiều cao từ 61 – 69 cm và cân nặng từ 30 – 41 kg. Thân hình của loài chó này không hề gây cảm giác nặng nề mà rất linh hoạt và nhanh nhẹn.",
