      breed_name: "Chó Otterhound",
      appearance:
        "Chó Otterhound có thân hình lớn và cơ bắp, chiều cao từ 24 đến 27 inch (khoảng 61 đến 69 cm) và cân nặng từ 65 đến 115 pound (khoảng 29 đến 52 kg). Đầu lớn, mũi mạnh mẽ, và đôi tai dài, lõm và đứng. Đôi mắt to và tròn thể hiện sự thông minh. Bộ lông dày và thô, kết hợp giữa các gam màu đỏ, xám, và đen, tạo nên vẻ ngoài đặc biệt. Otterhound trông ấn tượng và phong cách với hình dáng lớn và hấp dẫn.",
      behavior:
        "Chó Otterhound có tính cách mạnh mẽ, độc lập và hiếu động. Họ thường rất vui vẻ và tinh nghịch, luôn sẵn lòng tham gia vào mọi hoạt động với sự nhiệt huyết và sự tò mò. Otterhound thích khám phá và làm việc ngoài trời, và họ có khả năng theo dõi mùi và săn đuổi theo bản năng. Tính cách của họ thể hiện sự thông minh và can đảm, làm cho họ trở thành bạn đồng hành lý tưởng cho các hoạt động săn bắt hoặc điều tra. Mặc dù có tính cách độc lập và quyết đoán, nhưng Otterhound cũng rất thân thiện và gần gũi với con người, thể hiện sự tình cảm và sự gắn bó với gia đình của mình.",
