      breed_name: "Chó Norfolk terrier",
      appearance:
        "Norwich Terrier có dáng nhỏ nhưng khỏe mạnh, cao khoảng 25 cm và nặng từ 4-6 kg. Chúng có đôi tai tam giác đứng và đuôi cộc. Lông dày, mặt biểu cảm với mắt to và lông mày. Lông thẳng và rậm, thường màu nâu, nâu đỏ hoặc xám.",
      behavior:
        "Những con chó nhỏ nhưng cứng rắn này có thể can đảm, thông minh và trìu mến. Chúng có thể quyết đoán nhưng không phải là điển hình để chúng trở nên hung dữ, gây tranh cãi hoặc nhút nhát. Họ rất năng động và phát triển mạnh trong một cuộc sống năng động. Họ cũng khá đói và sẽ ăn bất cứ thứ gì ăn được. Họ háo hức muốn làm nhưng có tâm trí riêng của họ. Họ rất nhạy cảm với trách mắng nhưng 100% Terrier. Họ không nên thường xuyên được giữ bên ngoài hoặc trong một thiết lập cũi bởi vì họ tận hưởng sự đồng hành của chủ sở hữu của họ. Norwich không được đưa ra để sủa không cần thiết, nhưng họ sẽ cảnh báo về một người lạ đến gần. Một khi họ nhận ra rằng không có mối đe dọa, họ có thể trở thành bạn bè ngay lập tức. Norwich nói chung là tốt với trẻ em, và nếu giới thiệu với vật nuôi hộ gia đình khác như một con chó con họ thường đồng thói quen một cách hòa bình, mặc dù thận trọng nên được quan sát xung quanh động vật gặm nhấm vì chúng có thể bị nhầm lẫn với con mồi. ",
      common_health_issues:
        "Giống chó Norwich Terrier sống thoải mái trong nhà, tuy nhiên chúng rất hiếu động trong nhà, loài chó này luôn tràn đầy năng lượng và năng động, vì vậy chúng cần được đi dạo, vận động và vui chơi hàng ngày.\nCác khảo sát về giống chó của Mỹ và Anh đã đưa tuổi thọ của giống chó Norwich Terrier lên 13-13,5 năm. [3] Trong khi Norwich Terrier được coi là một giống lành mạnh, có một số vấn đề sức khỏe mà các nhà lai tạo có trách nhiệm thực hiện xét nghiệm sức khỏe di truyền phòng ngừa, do đó làm giảm tỷ lệ mắc bệnh.\nNorwich Terrier có một khuynh hướng cho một số vấn đề sức khỏe nhưng các nghiên cứu để xác định chính xác chế độ thừa kế hoặc tần số chính xác trong giống chưa được biết hoặc chưa được kết luận. Hiện tại không có rối loạn nào được xác định là “quan trọng nhất”. Của cường độ trung học, đục thủy tinh thể được công nhận là một rối loạn đã được báo cáo rải rác và có thể được thừa hưởng. Ngoài ra của một cường độ trung học có những trường hợp của động kinh , hẹp khí quản, luxating patellas , loạn sản hông , bệnh van hai lá , shunts portosystemic , [4] atopy (dị ứng viêm da) và cắn không chính xác (làm thế nào các răng đáp ứng khi hàm được đóng) .\nGiống như tất cả những con chó, Norwich Terriers có thể có phản ứng tự miễn dịch đối với bệnh dại. Bệnh lý da liễu thiếu máu do vi-rút gây bệnh dại , hoặc RVI-ID, là một phản ứng không gây tử vong nhưng có khả năng nghiêm trọng đối với hóa chất được gọi là tá dược trong thuốc chủng.",
