      breed_name: "Chó Komondor",
      appearance:
        "Chó Komondor có bộ lông dài xoăn ốc màu trắng, tạo nên vẻ ngoài mạnh mẽ và đặc biệt. Đầu được che phủ bởi lớp lông dày, chỉ để lộ đôi mắt lớn và sáng bóng. Chúng toát lên sự tự tin và quyết đoán trong cử động.",
      behavior:
        "Chó Komondor thường có tính cách mạnh mẽ, độc lập và trung thành. Chúng là những người bảo vệ tuyệt vời, luôn sẵn sàng bảo vệ gia đình và lãnh địa của mình khỏi bất kỳ mối đe dọa nào. Tính cách kiên định và quả cảm của chúng khiến cho chúng trở thành một sự lựa chọn lý tưởng cho việc bảo vệ và gác đền. Tuy nhiên, Komondor cũng có một mặt khác là rất trung thành và yêu thương với gia đình của mình. Chúng có thể trở nên rất tình cảm và gắn bó với những người họ yêu thương, thể hiện qua sự quan tâm và sự chăm sóc. Mặc dù có thể hiện ra sự độc lập và mạnh mẽ, nhưng chó Komondor cũng cần được huấn luyện và xã giao từ nhỏ để phát triển tính cách cân bằng và thân thiện với mọi người và động vật khác.",
      common_health_issues:
        "Komondor là một giống chó khỏe mạnh và sẵn lòng đối mặt với nhiều thử thách, nhưng giống như các giống chó khác, chúng cũng có thể gặp một số vấn đề sức khỏe cụ thể. Dưới đây là một số tình trạng sức khỏe tiềm năng mà bạn nên biết để có thể chăm sóc bé cún một cách tốt nhất và lựa chọn chó giống thích hợp.\n\n1. Chứng loạn sản xương hông: Đây là một bệnh thoái hóa thường xảy ra ở một số giống chó, trong đó khớp hông bị suy yếu do tăng trưởng và phát triển bất thường. Mặc dù không phải tất cả các Komondor đều bị chứng này, tuy nhiên, nếu nhận ra điều này sớm, bạn có thể giúp bé cún phát triển khỏe mạnh hơn.\n\n2. Quặm mi: Khiếm khuyết này thường rõ ràng khi bé cún đạt đến khoảng sáu tháng tuổi, khiến mí mắt cuộn vào trong và gây kích ứng hoặc tổn thương mắt. Điều này có thể ảnh hưởng đến một hoặc cả hai mắt của chó. Nếu bạn nhận thấy bé Komondor của mình có triệu chứng này, hãy tham khảo bác sĩ thú y để xác định liệu có cần phẫu thuật khi chó trưởng thành để khắc phục tình trạng này.\n\n3. Xoắn dạ dày (đầy hơi): Đầy hơi là tình trạng mà luồng khí và không khí tràn vào dạ dày một cách đột ngột, làm cho dạ dày căng lên và xoắn lại. Điều này có thể gây tử vong nếu không được điều trị kịp thời. Dấu hiệu xoắn dạ dày bao gồm việc chó trở nên mệt mỏi và đau đớn, cản trở tiêu hóa, và mở miệng ra rộ để thử giảm áp lực dạ dày.",
